import { useEffect, useState } from 'react';
import './App.css';

function App() {

  const [coordinates, setCoordinates] = useState([])
  const [city, setCity] = useState([])

  useEffect(()=>{

    fetch('http://api.geonames.org/searchJSON?q=london&maxRows=10&username=10&mkskhjwssofwfjjcjw00')
      .then(data => data.json())
      .then(data => setCoordinates(data))
      .catch(() => alert('error coordinates'))


    fetch('https://api.weatherbit.io/v2.0/current?lat=49.75187&lon=31.47003&key=097dd5fffd324ebb875e47ef3fed2fa1	')
      .then(data => data.json())
      .then(data => setCity(data.data))
      .catch(error => alert(error))
  },[])

  // console.log(coordinates)

  return (
    <div className="App">
      {city.map(item => <div>
        <h3>{item.city_name}</h3>
        <h1>{item.temp}</h1>
        <p>{item.ob_time}</p>
      </div>)}
    </div>
  );
}

export default App;
